import React from 'react'

const LogIn = () => {
    return (
        <div>
            <form action="">
                <input type="email" placeholder='email' />
                <input type="password" placeholder='enter  password' />
                <input type="password" placeholder='confirm password' />

            </form>
        </div>
    )
}

export default LogIn
